import React from 'react';
import PropTypes from 'prop-types';
import '../../assets/scss/components/Header/HeaderDes.scss';

HeaderDes.propTypes = {};

function HeaderDes(props) {
  return (
    <div className='header'>
      <h1 className='header__title'>A lifetime of discounts? It's Genius.</h1>
      <p className='header__text'>
        Get rewarded for your travels - unlock instant saving of 10% or more
        with a free account
      </p>
      <button className='header__btn'>Sign in/ Register</button>
      <div className='header__search'></div>
    </div>
  );
}

export default HeaderDes;
